import styles from "./AddUser.module.css";

const AddUser = () => {
    return (
        <form className={styles['new-user']}>
            <div>
                <label>
                    Username
                </label>
                <input type="text" />
                <label>
                    Age (year)
                </label>
                <input type="text" />
            </div>
        </form>
    );
};

export default AddUser;
